import React from 'react';

//components

const LeftFeed = () => {

    return (
        <div className="left-feed" >
            <div className="text-bold text-grey">Followers</div>
            <p><a href="">Bikash</a></p>
            <p><a href="">Arto</a></p>
            <p><a href="">Joonas</a></p>



        </div>
    )


}

export default LeftFeed;
